package com.dcits.galaxy.cache.redis.test;

public class TabTrail {
    private String prdType;
    private String prdId;
    private String prdComment;
    private String prdStatus;
    private String prdDatetime;
    
	public String getPrdType() {
		return prdType;
	}
	public void setPrdType(String prdType) {
		this.prdType = prdType;
	}
	public String getPrdId() {
		return prdId;
	}
	public void setPrdId(String prdId) {
		this.prdId = prdId;
	}
	public String getPrdComment() {
		return prdComment;
	}
	public void setPrdComment(String prdComment) {
		this.prdComment = prdComment;
	}
	public String getPrdStatus() {
		return prdStatus;
	}
	public void setPrdStatus(String prdStatus) {
		this.prdStatus = prdStatus;
	}
	public String getPrdDatetime() {
		return prdDatetime;
	}
	public void setPrdDatetime(String prdDatetime) {
		this.prdDatetime = prdDatetime;
	}
	
    
    
}
